import { BrowserRouter as Router } from 'react-router-dom';
import AppRoutes from './routes/AppRoutes';
import { AuthProvider } from './context/AuthContext';
import { OrderProvider } from './context/OrderContext';

function App() {
  return (
    <AuthProvider>
      <OrderProvider>
        <Router>
          <AppRoutes />
        </Router>
      </OrderProvider>
    </AuthProvider>
  );
}

export default App;
